import withLayout from '../components/Layout'
import Link from 'next/link'

const PostLink = (props: any) => {
  return (
    <li>
      <Link href={'/users/[id]'} as={`/users/${props.id}`}>
        <a>{ props.title }</a>
      </Link>
    </li>
  )
}

const Index: React.FC = () => (
  <div>
    <h1>Home Page</h1>
    <ul>
      <PostLink id="1" title="Post 1"/>
      <PostLink id="2" title="Post 2"/>
      <PostLink id="3" title="Post 3"/>
    </ul>
  </div>
)

export default withLayout(Index)
